import React from 'react';

const Contact = () => {

  return (
    <div className="">
      <div className="background-image"></div>
      <div className="contact-body">
        <h4>If you have any questions or need access, please send an email to <a href={"mailto:arum.galadima@jacobseye.com"}>arum.galadima@jacobseye.com</a> with the subject "RPS Site".</h4>
      </div>
    </div>
  )
}

export default Contact;
